<!DOCTYPE html>
<html lang="ar">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>بطاقتي NFC</title>
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.4.0/css/all.min.css">
<script src="https://cdn.jsdelivr.net/npm/qrcode/build/qrcode.min.js"></script>
<style>
@import url('https://fonts.googleapis.com/css2?family=Cairo:wght@400;700&display=swap');

body {
  margin: 0;
  font-family: 'Cairo', sans-serif;
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  background: #f2f2f2;
}

.card {
  width: 90%;
  max-width: 380px;
  border-radius: 20px;
  overflow: hidden;
  box-shadow: 0 10px 25px rgba(0,0,0,0.2);
  background: #fff;
}

/* الجزء العلوي باللون الأسود الخفيف */
.card-top {
  background: #2b2b2b;
  padding: 25px 20px 60px 20px; 
  text-align: center;
  color: #fff;
  position: relative;
}

.card-top .wave {
  position: absolute;
  bottom: 0;
  left: 0;
  width: 100%;
  height: 60px;
}

.avatar-container {
  position: relative;
  display: inline-block;
  margin-bottom: 15px;
  z-index: 2;
}

/* التوهج حول الصورة الشخصية */
.avatar-glow {
  position: absolute;
  top: -10px;
  left: -10px;
  width: 150px;
  height: 150px;
  background: rgba(245,240,225,0.5); /* لون بيج فاتح */
  border-radius: 50%;
  filter: blur(20px);
  z-index: 1;
}

.avatar {
  position: relative;
  width: 130px;
  height: 130px;
  border-radius: 50%;
  border: 4px solid #fff;
  object-fit: cover;
  z-index: 2;
}

.card-top h1 {
  margin: 10px 0 5px;
  font-size: 22px;
}

.card-top p {
  margin: 3px 0;
  font-size: 14px;
}

/* الجزء السفلي باللون البيج */
.card-bottom {
  background: #f5f0e1; /* بيج فاتح */
  padding: 20px;
  text-align: center;
}

.card-bottom p {
  font-size: 14px;
  color: #555;
  margin: 5px 0;
}

.social-links a {
  margin: 0 8px;
  font-size: 22px;
  color: #2b2b2b;
  text-decoration: none;
}

.social-links a:hover {
  color: #555;
}

.qrcode canvas {
  width: 110px !important;
  height: 110px !important;
  margin-top: 12px;
}

.btn {
  display: inline-block;
  margin-top: 15px;
  padding: 10px 18px;
  font-size: 14px;
  background: #2b2b2b;
  color: #fff;
  border-radius: 10px;
  text-decoration: none;
}

.btn:hover {
  background: #555;
}
</style>
</head>
<body>

  <!-- الجزء العلوي -->
